if ( ! function_exists( 'dine_option_fonts' ) ) :
/**
 * Returns font array used for customization
 *
 * @since 1.0
 */
function dine_option_fonts() {
    $fontArr = array();
    foreach ( dine_normal_fonts() as $font => $val ) {
        $fontArr[ $font ] = $font;
    }
    foreach ( dine_google_fonts() as $font => $val ) {
        $fontArr[ $font ] = $font;
    }
    return $fontArr;
}
endif;

